58: @Test public void dropsDuplicateAttributes() {
59: String html = "<p One=One ONE=Two Two=two one=Three One=Four two=Five>Text</p>";
60: Parser parser = Parser.htmlParser().setTrackErrors(10);
61: Document doc = parser.parseInput(html, "");
62: 63: Element p = doc.selectFirst("p");
64: assertEquals("<p one=\"One\" two=\"two\">Text</p>", p.outerHtml()); // normalized names due to lower casing
65: 66: assertEquals(1, parser.getErrors().size());
67: assertEquals("Duplicate attribute", parser.getErrors().get(0).getErrorMessage());
68: }
